import './App.css';
import {BrowserRouter as Router,Switch,Route} from 'react-router-dom';
import SignIn from './pages/SignIn';
import SignUp from './pages/SignUp';
import Home from './pages/Home';
import LandingPage from './pages/LandingPage';
import Profile from './pages/Profile';
import SingleProfile from './pages/SingleProfile';
import NotFound from './pages/NotFound';

function App() {
  return (
    <Router>
      <div className="App">
      <Switch>
        {/* Route:is the component user needs to see when they will navigate to that path. */}
        <Route path="/"  components={LandingPage}/>
				<Route path="/Home"  components={Home}/>
				<Route path="/SignIn" components={SignIn}/>
				<Route path="/SignUp" components={SignUp}/>
        <Route path="/LandingPage" components={LandingPage}/>
        <Route path="Profile" components={Profile}/>
        <Route path="SingleProfile" components={SingleProfile}/>
        <Route path="NotFound" components={NotFound}/>
        <Route/>
			</Switch>

    </div>
    </Router>

  );
}

export default App;
